import PropTypes from 'prop-types'

const Button = ({text, onClick}) => {
    return (
        <button
            onClick = {onClick}
            className='btn'
        >
            {text}
        </button>
    )
}

Button.PropTypes = {
    text: PropTypes.string,
    onClick: PropTypes.func.isRequired,
}
